      SELECT + ( + - CAST ( + - CAST ( NULL AS INTEGER ) AS INTEGER ) ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT IN ( - + col2 + - - col2, 51 * + + 90 );
  - name: tab0

outputs:
  - name: q5151.out
    data: |
